import React from "react";
const Home = () => {
    return (
        <section id="home" className="home">
            <div className="home__text-wrapper">
                <h1>Hi, I'm Dhanush
                    <br/>Full Stack Developer </h1>
            </div>
        </section>
    );
}
export default Home;
